const darkTheme = {
  palette: {
    mode: 'dark',
    primary: {
      main: '#eb7134',
    },
  },
};
const lightTheme = {
  palette: {
    type: 'light',
    primary: {
      main: '#2ecc71',
      contrastText: '#fff',
    },
    secondary: {
      main: '#bb8fce',
      contrastText: '#fff'
    },
  },
};

export {lightTheme};
export {darkTheme};
